import React from "react";

const espressoProducts = [
  { id: 1, name: "Espresso Classic", price: 3 },
  { id: 2, name: "Espresso Macchiato", price: 3.5 },
  // add more espresso products if you want
];

export default function Espresso({ addToCart }) {
  return (
    <div>
      <h1>Espresso Menu</h1>
      <ul>
        {espressoProducts.map((product) => (
          <li key={product.id} style={{ marginBottom: "1rem" }}>
            {product.name} - ${product.price.toFixed(2)}{" "}
            <button onClick={() => addToCart(product)}>Add to Cart</button>
          </li>
        ))}
      </ul>
    </div>
  );
}
